		protected void Page_Load(object sender, EventArgs e)
		{
			if (!Page.IsPostBack)
			{//If this is the first page load
				DisplayPeople();
			}
			
			lblTheAnswer.Text = "";
		}

		protected void DisplayPeople()
		{//Loop through the current dataset, and display its contents
			litCurrentDataset.Text = "{";
			
			for (int i = 0; i <= peopleArr.GetUpperBound(0); i++)
			{
				litCurrentDataset.Text += "[";
				litCurrentDataset.Text += peopleArr[i, 0].ToString() + ",";
				litCurrentDataset.Text += peopleArr[i, 1].ToString() + ",";
				litCurrentDataset.Text += peopleArr[i, 2].ToString();
				litCurrentDataset.Text += "]";
			}

			litCurrentDataset.Text += "}";
		}

		protected void btnSeedNewDataset_Click(object sender, EventArgs e)
		{//Define a new dataset and seed it with new data
			int numberOfPeople = 0;
			var birthYear = 0;
			var endYear = 0;
			Random r = new Random();

			try
			{	numberOfPeople = Convert.ToInt32(txtNumberOfPoeple.Text);	}
			catch (Exception ex)
			{	lblTheAnswer.Text = "Please enter a valid number";	}
			
			peopleArr = new string[numberOfPeople, 3];

			for (int i = 0; i <= peopleArr.GetUpperBound(0); i++)
			{//For each person, give them a random name, birthyear, and endYear
				birthYear = r.Next(1900, 2000);
				endYear = r.Next(birthYear, 2000);

				peopleArr[i, 0] = firstNames[r.Next(0, 2266)].ToString() + " " + lastNames[r.Next(0, 1471)].ToString();
				peopleArr[i, 1] = birthYear.ToString();
				peopleArr[i, 2] = endYear.ToString();
			}
			
			//Display the data
			DisplayPeople();

			//Display the answer
			FindAnswer();
		}

		protected void FindAnswer()
		{//Loop through the dataset and find the answer
			var livingPeopleCount = 0;
			var tmpLivingPeopleCount = 0;
			var theAnswer = 1900;

			for (int year = 1900; year <= 2000; year++)
			{//For each year - loop through the dataset of People and find the number of living
				tmpLivingPeopleCount = 0;

				for (int i = 0; i <= peopleArr.GetUpperBound(0); i++)
				{
					int birthYear = Convert.ToInt32(peopleArr[i, 1]);
					int endYear = Convert.ToInt32(peopleArr[i, 2]);
					if (birthYear <= year && endYear >= year)
					{//If the person is alive in the specified year, increment the counter
						tmpLivingPeopleCount++;
					}
				}

				if (tmpLivingPeopleCount > livingPeopleCount)
				{//We have a new max tmpLivingPeopleCount - update the answer
					livingPeopleCount = tmpLivingPeopleCount;
					theAnswer = year;
				}
			}

			if (theAnswer != 1900 && livingPeopleCount != 0)
			{//If we have a valid answer (the dataset is not empty)
				lblTheAnswer.Text = "The answer is the year " + theAnswer.ToString() + " when there were " + livingPeopleCount.ToString() + " living people.";
			}
		}
	}
